usage-and-example.html.body:
Usage & Example
Rusoto includes a public module for each AWS service it is compiled for, which
contains the Rust types for that service's API. A full list of these services
can be found on the Supported AWS Services page. All
other public types are reexported to the crate root. Consult the rustdoc
documentatation by running cargo doc or visiting the online
API documentation for the latest crates.io release.
A simple example of using Rusoto's DynamoDB API to list the names of all the
tables in a database:
extern crate rusoto;

use std::default::Default;

use rusoto::{DefaultCredentialsProvider, Region};
use rusoto::dynamodb::{DynamoDbClient, ListTablesInput};

fn main() {
  let provider = DefaultCredentialsProvider::new().unwrap();
  let client = DynamoDbClient::new(provider, Region::UsEast1);
  let list_tables_input: ListTablesInput = Default::default();

  match client.list_tables(&list_tables_input) {
    Ok(output) => {
      match output.table_names {
        Some(table_name_list) => {
          println!("Tables in database:");

          for table_name in table_name_list {
            println!("{}", table_name);
          }
        }
        None => println!("No tables in database!"),
      }
    }
    Err(error) => {
      println!("Error: {:?}", error);
    }
  }
}

debugging.html.body:
Debugging
Rusoto uses the log logging facade. For tests, Rusoto uses
env_logger.
In order to see logging output (e.g. the actual requests made to AWS),
env_logger needs to be initialized:
#[test]
fn list_objects_test() {
    let _ = env_logger::init(); // This initializes the `env_logger`

    let bare_s3 = S3Client::new(
        DefaultCredentialsProvider::new().unwrap(),
        Region::UsWest2
    );
    let mut list_request = ListObjectsRequest::default();
    list_request.bucket = "rusototester".to_string();
    let result = bare_s3.list_objects(&list_request).unwrap();
    println!("result is {:?}", result);
}

To see the output of logging from integration tests, the command needs to be run
as follows:
RUST_LOG=debug cargo test --features all
To get the logging output as well as the output of any println! statements,
run:
RUST_LOG=debug cargo test --features all -- --nocapture
